import NavBar from "../NavBar";
const AddToDo = () => {
  const addToDo = () => {
    const todoText = useRef();
  };
  return (
    <>
      {" "}
      <NavBar />
      <div className="todo_container">
        <h1>Add ToDo's :</h1>
        <br />
        <form onSubmit={addToDo}>
          <input type="text" ref={todoText} />
          <button>Add</button>
        </form>
      </div>
    </>
  );
};
export default AddToDo;
